import React from 'react';
import Courses from './Courses';

export default function CoursesList({ cards }) {
   const courseElements = cards.map(courses)
   return (
      <div>
         <Courses card={cards[0]} />
         <Courses card={cards[1]} />
         <Courses card={cards[2]} />
         <Courses card={cards[3]} />
      </div>
   )
};
